INSERT INTO `question` VALUES (12,'Um monitor de 15 polegadas apresenta 1024 pixéis na horizontal e 768 na vertical. Uma imagem com dimensões de 1024 pixels por 768 pixéis preencherá este ecrã. O que acontecerá num monitor mais largo, e utilizando a mesma imagem (com dimensões de 1024 por 768 pixels)?',1),(13,'Um monitor de 15 polegadas apresenta 1024 pixéis na horizontal e 768 na vertical. Uma imagem com dimensões de 1024 pixels por 768 pixéis preencherá este ecrã. O que acontecerá num monitor mais largo, e utilizando a mesma imagem (com dimensões de 1024 por 768 pixels)?',1),(14,'Quando falamos de imagem, é preciso ter em atenção que tipo de imagem vamos trabalhar. Se for fotografia, trataremos de um tipo de imagem; se for para elaborarem cartazes para impressão, falamos de outro tipo de imagem. Indique os dois tipos de imagens e explique o seu sistema de cores.',1),(15,'Imagine que tem duas imagens uma em formato JPEG e outra em formato em formato TIFF, ao visualizar no monitor, qual a para si, verá com mais qualidade.',1);
